-- Creando SIGLAS ENTIDAD
CREATE TABLE sigla_entidad (
   n_id_sigent NUMBER(12),
   n_id_organ NUMBER(12),
   c_sigla VARCHAR2(100),
   n_estado VARCHAR2(100),
   d_feccre DATE,
   c_usucre NUMBER(13),
   c_usumo NUMBER(13),
   d_fecmu DATE,
   CONSTRAINT sigla_entidad_pk PRIMARY KEY(n_id_sigent),
   CONSTRAINT sig_ent_fk FOREIGN KEY (n_id_organ) REFERENCES entidad(n_id_organ)
);


select * from sigla_entidad;
